import React from "react";
import theme from "./theme/theme"
import Header from "./components/Header";
import { Box, Grid, ThemeProvider } from "@material-ui/core";

export default () => {
  return(
  <ThemeProvider theme={theme}>
    <Header />
    <Grid container justify="center">
      <Grid item xs={10}>

      </Grid>

    </Grid>
  </ThemeProvider>
  )
};
